import React from 'react'
import { render } from "react-dom";
import { Chart } from "react-google-charts";

const Pie = () => {
    return (
        <div>
            <div className={"my-pretty-chart-container"}>
            <Chart
            chartType="ScatterChart"
            data={[["Age", "Weight"], [4, 5.5], [8, 12]]}
             width="100%"
            height="400px"
            legendToggle
        />
      </div>

        </div>
    )
}

export default Pie
